import React from 'react';
import ReactDOM from 'react-dom/client';
import { Windmill } from '@windmill/react-ui'

import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Windmill>
    <App />
  </Windmill>,
);
